import React from 'react';
import MenuItem from '../directory-item/directory-item.component';
import './directory.style.css';

class Directory extends React.Component {
    constructor() {
        super();

        this.state = {

            sections: [
                {
                    id: 0,
                    title: '"sndfvbndbnf scnkjsd"',
                    imageUrl: 'https://imgur.com/Q258MnF.jpg',
                },
                {
                    id: 1,
                    title: 'SKIN CARE',
                    imageUrl: 'https://imgur.com/ffyCHJo.jpg',
                },
                {
                    id: 2,
                    title: 'CLEANSING',
                    imageUrl: 'https://imgur.com/4HtUxTa.jpg',
                },
                {
                    id: 3,
                    title: 'BODY CARE',
                    imageUrl: 'https://imgur.com/60Sk8tE.jpg',
                },
                {
                    id: 4,
                    title: 'HAIR',
                    imageUrl: 'https://imgur.com/7Zk1BEK.jpg',
                }

            ]
        }
    }

    render(){
        return (
            <div className='directory-menu'>
                {
                    this.state.sections.map(({id, title, imageUrl}) => (
                        <MenuItem key={id} title={title} imageUrl={imageUrl}/>
                    ) )
                }
            </div>
        )
    }
}

export default Directory;
